void z_fix_rotateCounter(ZFix X, ZFix Y, unsigned Angle, ZFix* NewX, ZFix* NewY)
{
    const ZFix sin = z_fix_sin(Angle);
    const ZFix cos = z_fix_cos(Angle);

    *NewX = z_fix_mul(X,  cos) + z_fix_mul(Y, sin);
    *NewY = z_fix_mul(X, -sin) + z_fix_mul(Y, cos);
}

void z_fix_rotateClockwise(ZFix X, ZFix Y, unsigned Angle, ZFix* NewX, ZFix* NewY)
{
    const ZFix sin = z_fix_sin(Angle);
    const ZFix cos = z_fix_cos(Angle);

    *NewX = z_fix_mul(X, cos) + z_fix_mul(Y, -sin);
    *NewY = z_fix_mul(X, sin) + z_fix_mul(Y,  cos);
}
